#conectar sqlite y con pandas y crear la base de datos
import sqlite3

import pandas as pd

conn = sqlite3.connect('Nod-Foody.db')
print("Created database successfully");

#creacion de las tablas
conn.execute('''
  CREATE TABLE restaurants(
	  restaurant_id INT NOT NULL UNIQUE PRIMARY KEY,
  	restaurant_name VARCHAR,
  	location VARCHAR,
  	cuisine VARCHAR
);''')

conn.commit()

print("Table restaurants created successfully");

conn.execute('''
  CREATE TABLE users(
	  user_id INT NOT NULL UNIQUE PRIMARY KEY,
  	user_name VARCHAR,
  	email VARCHAR,
  	address VARCHAR
);''')

conn.commit()

print("Table users created successfully");

conn.execute('''
  CREATE TABLE orders(
	  order_id INT NOT NULL UNIQUE PRIMARY KEY,
  	user_id INT NOT NULL,
  	restaurant_id INT NOT NULL,
  	order_time TIMESTAMP,
    delivery_time TIMESTAMP,
    total_amount FLOAT,
    FOREIGN KEY(user_id) REFERENCES users(user_id),
    FOREIGN KEY(restaurant_id) REFERENCES restaurants(restaurant_id)
);''')

conn.commit()

print("Table orders created successfully");

conn.commit()
conn.close()

