#QUERY 1: ¿Cuántos pedidos se han realizado en cada restaurante durante el último mes?
conn = sqlite3.connect('Nod-Foody.db')
print("Opended database successfully");

qry='''
  SELECT COUNT(orders.order_id) AS total_pedidos, restaurants.restaurant_name
  FROM orders, restaurants
  WHERE orders.restaurant_id=restaurants.restaurant_id
  AND orders.order_time >= "2024-05-01 00:00:00"
  GROUP BY restaurants.restaurant_name
  ORDER BY total_pedidos DESC;
'''

df =pd.read_sql_query(qry, conn)

df.head(50)

