# QUERY 2: ¿Cuál es el usuario que ha realizado más pedidos?
conn = sqlite3.connect('Nod-Foody.db')
print("Opended database successfully");

qry = '''
  SELECT COUNT(o.user_id) AS pedidos, u.user_name
  FROM orders AS o, users AS u
  WHERE o.user_id = u.user_id
  GROUP BY u.user_name
  ORDER BY pedidos DESC
  LIMIT 1;
'''

df =pd.read_sql_query(qry, conn)

df.head(50)

# QUERY 3: ¿Cuál es el restaurante más popular entre los usuarios?
conn = sqlite3.connect('Nod-Foody.db')
print("Opended database successfully");
qry='''
  SELECT COUNT(o.order_id) AS ordenes_totales, r.restaurant_name
  FROM orders AS o
  INNER JOIN restaurants AS r
  ON o.restaurant_id = r.restaurant_id
  GROUP BY r.restaurant_name
  ORDER BY ordenes_totales DESC
  LIMIT 1;
'''

df =pd.read_sql_query(qry, conn)

df.head(50)

